  return StringBuilder.$create__().m_append__java_lang_String__java_lang_StringBuilder('{\n  \"about-modal\": {\n    \"name\": \"about-modal\",\n    \"title\": \"About modal\",\n    \"route\": \"/components/about-modal\",\n    \"illustration\": \"about-modal.png\",\n    \"summary\": \"An <b>about modal</b> displays information about an application like product version number(s), as well as any appropriate legal text.\"\n  },\n  \"accordion\": {\n    \"name\": \"accordion\",\n    \"title\": \"Accordion\",\n    \"route\": \"/components/accordion\",\n    \"clazz\": \"org.patternfly.component.accordion.Accordion\",\n    \"illustration\": \"accordion.png\",\n    \"summary\": \"An <b>accordion</b> is an interactive container that expands and collapses to hide or reveal nested content. It takes advantage of progressive disclosure to help reduce page scrolling, by allowing users to choose whether they want to show or hide more detailed information as needed.\"\n  },\n  \"action-list\": {\n    \"name\": \"action-list\",\n    \"title\": \"Action list\",\n    \"route\": \"/components/action-list\",\n    \"clazz\": \"org.patternfly.component.list.ActionList\",\n    \"illustration\": \"action-list.png\",\n    \"summary\": \"An <b>action list</b> is a group of actions, controls, or buttons with set spacing.\"\n  },\n  \"alert\": {\n    \"name\": \"alert\",\n    \"title\": \"Alert\",\n    \"route\": \"/components/alert\",\n    \"clazz\": \"org.patternfly.component.alert.Alert\",\n    \"illustration\": \"alert.png\",\n    \"summary\": \"An <b>alert</b> is a notification that provides brief information to the user without blocking their workflow.\"\n  },\n  \"application-launcher\": {\n    \"name\": \"application-launcher\",\n    \"title\": \"Application launcher\",\n    \"route\": \"/components/application-launcher\",\n    \"illustration\": \"application-launcher.png\",\n    \"summary\": \"An <b>application launcher</b> is an option menu that allows a user to launch a separate web application in a new browser window.\"\n  },\n  \"avatar\": {\n    \"name\": \"avatar\",\n    \"title\": \"Avatar\",\n    \"route\": \"/components/avatar\",\n    \"clazz\": \"org.patternfly.component.avatar.Avatar\",\n    \"illustration\": \"avatar.png\",\n    \"summary\": \"An <b>avatar</b> is a visual used to represent a user. It may contain an image or a placeholder graphic.\"\n  },\n  \"back-to-top\": {\n    \"name\": \"back-to-top\",\n    \"title\": \"Back to top\",\n    \"route\": \"/components/back-to-top\",\n    \"clazz\": \"org.patternfly.component.backtotop.BackToTop\",\n    \"illustration\": \"back-to-top.png\",\n    \"summary\": \"The <b>back to top</b> component is a shortcut that allows users to quickly navigate to the top of a lengthy content page. \"\n  },\n  \"backdrop\": {\n    \"name\": \"backdrop\",\n    \"title\": \"Backdrop\",\n    \"route\": \"/components/backdrop\",\n    \"illustration\": \"backdrop.png\",\n    \"summary\": \"A <b>backdrop</b> is used to screen the main content of a page when a modal overlay is opened. It prevents the user from doing other work on the page until the modal is dismissed.\"\n  },\n  \"background-image\": {\n    \"name\": \"background-image\",\n    \"title\": \"Background image\",\n    \"route\": \"/components/background-image\",\n    \"illustration\": \"background-image.png\",\n    \"summary\": \"A <b>background image</b> allows you to place an image in the background of your page or area of a page.\"\n  },\n  \"badge\": {\n    \"name\": \"badge\",\n    \"title\": \"Badge\",\n    \"route\": \"/components/badge\",\n    \"clazz\": \"org.patternfly.component.badge.Badge\",\n    \"illustration\": \"badge.png\",\n    \"summary\": \"A <b>badge</b> is used to annotate other information like a label or an object name.\"\n  },\n  \"banner\": {\n    \"name\": \"banner\",\n    \"title\": \"Banner\",\n    \"route\": \"/components/banner\",\n    \"clazz\": \"org.patternfly.component.banner.Banner\",\n    \"illustration\": \"banner.png\",\n    \"summary\": \"A <b>banner</b> is a 1-line, full color, full width container that can be used to communicate short snippets of information to users. Banners are un-intrusive and non-dismissible.\"\n  },\n  \"brand\": {\n    \"name\": \"brand\",\n    \"title\": \"Brand\",\n    \"route\": \"/components/brand\",\n    \"clazz\": \"org.patternfly.component.brand.Brand\",\n    \"illustration\": \"brand.png\",\n    \"summary\": \"A <b>brand</b> is used to place a product logotype on a screen.\"\n  },\n  \"breadcrumb\": {\n    \"name\": \"breadcrumb\",\n    \"title\": \"Breadcrumb\",\n    \"route\": \"/components/breadcrumb\",\n    \"clazz\": \"org.patternfly.component.breadcrumb.Breadcrumb\",\n    \"illustration\": \"breadcrumb.png\",\n    \"summary\": \"A <b>breadcrumb</b> provides page context to help users navigate more efficiently and understand where they are in the application hierarchy.\"\n  },\n  \"button\": {\n    \"name\": \"button\",\n    \"title\": \"Button\",\n    \"route\": \"/components/button\",\n    \"clazz\": \"org.patternfly.component.button.Button\",\n    \"illustration\": \"button.png\",\n    \"summary\": \"A <b>button</b> is a box area or text that communicates and triggers user actions when clicked or selected. Buttons can be used to communicate and immediately trigger actions a user can take in an application, like submitting a form, canceling a process, or creating a new object. Buttons can also be used to take a user to a new location, like another page inside of a web application, or an external site such as help or documentation.\"\n  },\n  \"calendar-month\": {\n    \"name\": \"calendar-month\",\n    \"title\": \"Calendar month\",\n    \"route\": \"/components/date-and-time/calendar-month\",\n    \"illustration\": \"calendar-month.png\",\n    \"summary\": \"A <b>calendar month</b> component allows users to select and navigate between days, months and/or years. This component is usually used with the date picker component, to display date options and selections. For more information about usage, view <a href=\'https://www.patternfly.org/components/date-and-time/date-picker/design-guidelines\' target=\'patternfly\'>date picker guidelines</a>.\"\n  },\n  \"card\": {\n    \"name\": \"card\",\n    \"title\": \"Card\",\n    \"route\": \"/components/card\",\n    \"clazz\": \"org.patternfly.component.card.Card\",\n    \"illustration\": \"card.png\",\n    \"summary\": \"A <b>card</b> is a square or rectangular container that can contain any kind of content. Cards symbolize units of information, and each one acts as an entry point for users to access more details. For example, in dashboards and catalog views, cards function as a preview of a detailed page. Cards may also be used in data displays like card views, or for positioning content on a page. \"\n  },\n  \"checkbox\": {\n    \"name\": \"checkbox\",\n    \"title\": \"Checkbox\",\n    \"route\": \"/components/forms/checkbox\",\n    \"clazz\": \"org.patternfly.component.form.Checkbox\",\n    \"illustration\": \"checkbox.png\",\n    \"summary\": \"A <b>checkbox</b> is used to select a single item or multiple items, typically to choose elements to perform an action or to reflect a binary setting.\"\n  },\n  \"chip\": {\n    \"name\": \"chip\",\n    \"title\": \"Chip\",\n    \"route\": \"/components/chip\",\n    \"clazz\": \"org.patternfly.component.chip.Chip\",\n    \"illustration\": \"chip.png\",\n    \"summary\": \"A <b>chip</b> is used to communicate a value or a set of attribute-value pairs within workflows that involve filtering a set of objects.\"\n  },\n  \"clipboard-copy\": {\n    \"name\": \"clipboard-copy\",\n    \"title\": \"Clipboard copy\",\n    \"route\": \"/components/clipboard-copy\",\n    \"illustration\": \"clipboard-copy.png\",\n    \"summary\": \"The <b>clipboard copy</b> component allows users to quickly and easily copy content to their clipboard.\"\n  },\n  \"code-block\": {\n    \"name\": \"code-block\",\n    \"title\": \"Code block\",\n    \"route\": \"/components/code-block\",\n    \"clazz\": \"org.patternfly.component.code.CodeBlock\",\n    \"illustration\": \"code-block.png\",\n    \"summary\": \"A <b>code block</b> is a component that contains 2 or more lines of read-only code. The code in a code block can be copied to the clipboard.\"\n  },\n  \"code-editor\": {\n    \"name\": \"code-editor\",\n    \"title\": \"Code editor\",\n    \"route\": \"/components/code-editor\",\n    \"clazz\": \"org.patternfly.component.code.CodeEditor\",\n    \"illustration\": \"code-editor.png\",\n    \"summary\": \"A <b>code editor</b> is a versatile text editor that allows for editing various languages. The code editor is built on top of the <a href=\'https://microsoft.github.io/monaco-editor/\' target=\'_blank\'>Monaco Editor</a>.\"\n  },\n  \"data-list\": {\n    \"name\": \"data-list\",\n    \"title\": \"Data list\",\n    \"route\": \"/components/data-list\",\n    \"illustration\": \"data-list.png\",\n    \"summary\": \"A <b>data list</b> is used to display large data sets when you need a flexible layout or need to include interactive content like charts.\"\n  },\n  \"date-picker\": {\n    \"name\": \"date-picker\",\n    \"title\": \"Date picker\",\n    \"route\": \"/components/date-and-time/date-picker\",\n    \"illustration\": \"date-picker.png\",\n    \"summary\": \"A <b>date picker</b> helps users enter or select a specific date from a calendar.\"\n  },\n  \"date-and-time-picker\": {\n    \"name\": \"date-and-time-picker\",\n    \"title\": \"Date and time picker\",\n    \"route\": \"/components/date-and-time/date-and-time-picker\",\n    \"illustration\": \"date-and-time-picker.png\",\n    \"summary\": \"A <b>date and time picker</b> helps users select both a specific date and a time by combining <a href=\'/components/date-and-time/date-picker\'>date picker</a> and <a href=\'/components/date-and-time/time-picker\'>time picker</a> components.\"\n  },\n  \"description-list\": {\n    \"name\": \"description-list\",\n    \"title\": \"Description list\",\n    \"route\": \"/components/description-list\",\n    \"clazz\": \"org.patternfly.component.list.DescriptionList\",\n    \"illustration\": \"description-list.png\",\n    \"summary\": \"A <b>description list</b> contains terms and their corresponding descriptions.\"\n  },\n  \"divider\": {\n    \"name\": \"divider\",\n    \"title\": \"Divider\",\n    \"route\": \"/components/divider\",\n    \"clazz\": \"org.patternfly.component.divider.Divider\",\n    \"illustration\": \"divider.png\",\n    \"summary\": \"A <b>divider</b> is a horizontal or vertical line that is placed between screen elements to create visual divisions and content groupings.\"\n  },\n  \"drag-and-drop\": {\n    \"name\": \"drag-and-drop\",\n    \"title\": \"Drag and drop\",\n    \"route\": \"/components/drag-and-drop\",\n    \"illustration\": \"drag-and-drop.png\",\n    \"summary\": \"The <b>drag and drop</b> interaction can be used to reposition elements on screen into a layout that benefits the user. This gives the user more flexibility to arrange and/or group items without having to make code changes.\"\n  },\n  \"drawer\": {\n    \"name\": \"drawer\",\n    \"title\": \"Drawer\",\n    \"route\": \"/components/drawer\",\n    \"clazz\": \"org.patternfly.component.drawer.Drawer\",\n    \"illustration\": \"drawer.png\",\n    \"summary\": \"A <b>drawer</b> is a sliding panel that enters from the right edge of the viewport. It can be configured to either overlay content on a page or create a sidebar by pushing that content to the left.\"\n  },\n  \"dropdown\": {\n    \"name\": \"dropdown\",\n    \"title\": \"Dropdown\",\n    \"route\": \"/components/menus/dropdown\",\n    \"clazz\": \"org.patternfly.component.menu.Dropdown\",\n    \"illustration\": \"dropdown.png\",\n    \"summary\": \"A <b>dropdown</b> presents a menu of actions or links in a constrained space that will trigger a process or navigate to a new location. See <a href=\'https://www.patternfly.org/components/menus/select/design-guidelines\' target=\'patternfly\'>select component guidelines</a> for more information about making one or more selections from a list of items in a value list.\"\n  },\n  \"dual-list-selector\": {\n    \"name\": \"dual-list-selector\",\n    \"title\": \"Dual list selector\",\n    \"route\": \"/components/dual-list-selector\",\n    \"illustration\": \"dual-list-selector.png\",\n    \"summary\": \"A <b>dual list selector</b> allows users to select and move items from one list of available items to another list of selected items. Unlike a select list, a dual list selector separates the available options and the selected options into two separate lists, which allows users to easily scan the items they selected.\"\n  },\n  \"empty-state\": {\n    \"name\": \"empty-state\",\n    \"title\": \"Empty state\",\n    \"route\": \"/components/empty-state\",\n    \"clazz\": \"org.patternfly.component.emptystate.EmptyState\",\n    \"illustration\": \"empty-state.png\",\n    \"summary\": \"An <b>empty state</b> is a screen that is not yet populated with data or information. Empty states typically contain a short message and next steps for the user.\"\n  },\n  \"expandable-section\": {\n    \"name\": \"expandable-section\",\n    \"title\": \"Expandable section\",\n    \"route\": \"/components/expandable-section\",\n    \"clazz\": \"org.patternfly.component.expandable.ExpandableSection\",\n    \"illustration\": \"expandable-section.png\",\n    \"summary\": \"An <b>expandable section</b> component is used to support progressive disclosure in a form or page by hiding additional content when you don\'t want it to be shown by default. An expandable section can contain any type of content such as plain text, form inputs, and charts.\"\n  },\n  \"multiple-file-upload\": {\n    \"name\": \"multiple-file-upload\",\n    \"title\": \"Multiple file upload\",\n    \"route\": \"/components/file-upload/multiple-file-upload\",\n    \"illustration\": \"file-upload-multiple.png\",\n    \"summary\": \"A <b>multiple file upload</b> component allows users to select 1 or more files to upload to a specific location. The component can be configured to support any file type as well as restrict the user\'s ability to upload 1 or more files. Users have the ability to select files from their system either natively using a file input or via drag and drop. Once uploaded, the user can edit any files.\"\n  },\n  \"simple-file-upload\": {\n    \"name\": \"simple-file-upload\",\n    \"title\": \"Simple file upload\",\n    \"route\": \"/components/file-upload/simple-file-upload\",\n    \"illustration\": \"file-upload.png\",\n    \"summary\": \"A <b>simple file upload</b> component allows the users to upload a single file into the browser. This is primarily used for uploading and previewing text files, but other file types will also be accepted.\"\n  },\n  \"form-control\": {\n    \"name\": \"form-control\",\n    \"title\": \"Form control\",\n    \"route\": \"/components/forms/form-control\",\n    \"clazz\": \"org.patternfly.component.form.FormControl\",\n    \"illustration\": \"form-control.png\",\n    \"summary\": \"<b>Form controls</b> refer to the different visual states that data input components can take to help guide users in completing forms.\"\n  },\n  \"form\": {\n    \"name\": \"form\",\n    \"title\": \"Form\",\n    \"route\": \"/components/forms/form\",\n    \"clazz\": \"org.patternfly.component.form.Form\",\n    \"illustration\": \"form.png\",\n    \"summary\": \"A <b>form</b> is a group of elements used to collect information from a user in a variety of contexts including in a modal, in a wizard, or on a page. Use cases for forms include tasks reliant on user-inputted information for completion like logging in, registering, configuring settings, or completing surveys.\"\n  },\n  \"form-select\": {\n    \"name\": \"form-select\",\n    \"title\": \"Form select\",\n    \"route\": \"/components/forms/form-select\",\n    \"clazz\": \"org.patternfly.component.form.FormSelect\",\n    \"illustration\": \"form-select.png\",\n    \"summary\": \"A <b>form select</b> embeds browser native select lists into a form.\"\n  },\n  \"helper-text\": {\n    \"name\": \"helper-text\",\n    \"title\": \"Helper text\",\n    \"route\": \"/components/helper-text\",\n    \"clazz\": \"org.patternfly.component.help.HelperText\",\n    \"illustration\": \"helper-text.png\",\n    \"summary\": \"<b>Helper text</b> is an on-screen field guideline that helps provide context regarding field inputs.\"\n  },\n  \"hint\": {\n    \"name\": \"hint\",\n    \"title\": \"Hint\",\n    \"route\": \"/components/hint\",\n    \"clazz\": \"org.patternfly.component.hint.Hint\",\n    \"illustration\": \"hint.png\",\n    \"summary\": \"A <b>hint</b> is in-app messaging that provides a one-step reminder, explanation, or call to action for a page or modal.\"\n  },\n  \"icon\": {\n    \"name\": \"icon\",\n    \"title\": \"Icon\",\n    \"route\": \"/components/icon\",\n    \"clazz\": \"org.patternfly.component.icon.Icon\",\n    \"illustration\": \"icon.png\",\n    \"summary\": \"An <b>icon</b> component is a container that allows for <a href=\'https://www.patternfly.org/design-foundations/icons#all-icons\' target=\'patternfly\'>icons</a> of varying dimensions, as well as <a href=\'/components/spinner\'>spinners</a>, to seamlessly replace each other without shifting surrounding content.<br/><br/>PatternFly\'s <a href=\'https://www.patternfly.org/design-foundations/icons#all-icons\' target=\'patternfly\'>icons guidelines</a> contain PatternFly\'s icon set, as well as more information about icon usage.\"\n  },\n  \"inline-edit\": {\n    \"name\": \"inline-edit\",\n    \"title\": \"Inline edit\",\n    \"route\": \"/components/inline-edit\",\n    \"illustra').m_append__java_lang_String__java_lang_StringBuilder('tion\": \"inline-edit.png\",\n    \"summary\": \"An <b>inline edit</b> component allows users to switch between a read-only view and an edit view of <a href=\'/components/description-list\'>description lists</a>, page text elements, or <a href=\'/components/table\'>tables</a> as needed. Inline editing saves the user from opening a modal window or redirecting to a separate edit page so that they can edit in context of their current view.\"\n  },\n  \"input-group\": {\n    \"name\": \"input-group\",\n    \"title\": \"Input group\",\n    \"route\": \"/components/input-group\",\n    \"clazz\": \"org.patternfly.component.inputgroup.InputGroup\",\n    \"illustration\": \"input-group.png\",\n    \"summary\": \"An <b>input group</b> groups multiple related controls or inputs together so they appear as one control.\"\n  },\n  \"jump-links\": {\n    \"name\": \"jump-links\",\n    \"title\": \"Jump links\",\n    \"route\": \"/components/jump-links\",\n    \"clazz\": \"org.patternfly.component.jumplinks.JumpLinks\",\n    \"illustration\": \"jump-links.png\",\n    \"summary\": \"<b>Jump links</b> allow users to navigate to sections within a page.\"\n  },\n  \"label\": {\n    \"name\": \"label\",\n    \"title\": \"Label\",\n    \"route\": \"/components/label\",\n    \"clazz\": \"org.patternfly.component.label.Label\",\n    \"illustration\": \"label.png\",\n    \"summary\": \"The <b>label</b> component allows users to add specific element captions for user clarity and convenience.\"\n  },\n  \"list\": {\n    \"name\": \"list\",\n    \"title\": \"List\",\n    \"route\": \"/components/list\",\n    \"clazz\": \"org.patternfly.component.list.List\",\n    \"illustration\": \"list.png\",\n    \"summary\": \"A <b>list</b> component embeds a formatted list (bulleted or numbered list) into page content.\"\n  },\n  \"login-page\": {\n    \"name\": \"login-page\",\n    \"title\": \"Login page\",\n    \"route\": \"/components/login-page\",\n    \"illustration\": \"login-page.png\",\n    \"summary\": \"A <b>login page</b> allows a user to gain access to an application by entering their username and password or by authenticating using a social media login.\"\n  },\n  \"masthead\": {\n    \"name\": \"masthead\",\n    \"title\": \"Masthead\",\n    \"route\": \"/components/masthead\",\n    \"clazz\": \"org.patternfly.component.page.Masthead\",\n    \"illustration\": \"masthead.png\",\n    \"summary\": \"A <b>masthead</b> contains global properties such as logotype, navigation and settings in an organized fashion and it is accessible from all parts of the application. All pages should share a common masthead.\"\n  },\n  \"menu-toggle\": {\n    \"name\": \"menu-toggle\",\n    \"title\": \"Menu toggle\",\n    \"route\": \"/components/menus/menu-toggle\",\n    \"clazz\": \"org.patternfly.component.menu.MenuToggle\",\n    \"illustration\": \"menu-toggle.png\",\n    \"summary\": \"The <b>menu toggle</b> component pairs with the <a href=\'/components/menus/menu\'>menu</a> OR the <a href=\'https://www.patternfly.org/components/panel/design-guidelines\'>panel</a> component to create more customizable dropdown and select implementations. Using a menu toggle with a menu enables you to create custom component configurations not supported by the standard dropdown or select components.\"\n  },\n  \"menu\": {\n    \"name\": \"menu\",\n    \"title\": \"Menu\",\n    \"route\": \"/components/menus/menu\",\n    \"clazz\": \"org.patternfly.component.menu.Menu\",\n    \"illustration\": \"menu.png\",\n    \"summary\": \"A <b>menu</b> is a list of options or actions that users can choose from. It can be used in a variety of contexts whenever the user needs to choose between multiple values, options, or actions. A menu is most often paired with a <a href=\'/components/menu-toggle\'>menu toggle</a> as its trigger, but can also be used inline or can be attached to other interactable elements to toggle it open and close.\"\n  },\n  \"modal\": {\n    \"name\": \"modal\",\n    \"title\": \"Modal\",\n    \"route\": \"/components/modal\",\n    \"illustration\": \"modal.png\",\n    \"summary\": \"A <b>modal</b> displays important information to a user without requiring them to navigate to a new page.\"\n  },\n  \"navigation\": {\n    \"name\": \"navigation\",\n    \"title\": \"Navigation\",\n    \"route\": \"/components/navigation\",\n    \"clazz\": \"org.patternfly.component.navigation.Navigation\",\n    \"illustration\": \"navigation.png\",\n    \"summary\": \"A <b>navigation</b> organizes an application\'s structure and content, making it easy to find information and accomplish tasks. Navigation communicates relationships, context, and actions a user can take within an application.\"\n  },\n  \"notification-badge\": {\n    \"name\": \"notification-badge\",\n    \"title\": \"Notification badge\",\n    \"route\": \"/components/notification-badge\",\n    \"illustration\": \"notification-badge.png\",\n    \"summary\": \"A <b>notification badge</b> is intended to be used with a <a href=\'/components/notification-drawer\'>notification drawer</a> as a visible indicator to alert the user about incoming notifications.\"\n  },\n  \"notification-drawer\": {\n    \"name\": \"notification-drawer\",\n    \"title\": \"Notification drawer\",\n    \"route\": \"/components/notification-drawer\",\n    \"illustration\": \"notification-drawer.png\",\n    \"summary\": \"A <b>notification drawer</b> is a place where users can view and manage notifications that are generated by the system. It allows them to see a list of notifications without the need to navigate away from the current screen.\"\n  },\n  \"number-input\": {\n    \"name\": \"number-input\",\n    \"title\": \"Number input\",\n    \"route\": \"/components/number-input\",\n    \"illustration\": \"number-input.png\",\n    \"summary\": \"A <b>number input</b> provides a quick and effective way for users to enter and modify a numeric value. Similar to <a href=\'/components/input-group/\'>input groups</a>, number inputs combine 2 input types into 1 control: A text input field with buttons on either side. When combined, these elements allow users to input numeric values in a responsive and scalable way.\"\n  },\n  \"overflow-menu\": {\n    \"name\": \"overflow-menu\",\n    \"title\": \"Overflow menu\",\n    \"route\": \"/components/overflow-menu\",\n    \"illustration\": \"overflow-menu.png\",\n    \"summary\": \"An <b>overflow menu</b> groups a set of actions in a responsive horizontal list to help declutter an interface. Actions can be set to persist or collapse into a kebab as the viewpoint shrinks. Overflow menus are useful in toolbars or other places where a group of actions is required.\"\n  },\n  \"page\": {\n    \"name\": \"page\",\n    \"title\": \"Page\",\n    \"route\": \"/components/page\",\n    \"clazz\": \"org.patternfly.component.page.Page\",\n    \"illustration\": \"page.png\",\n    \"summary\": \"The <b>page</b> component is used to define the basic layout of a page with either vertical or horizontal navigation.\"\n  },\n  \"pagination\": {\n    \"name\": \"pagination\",\n    \"title\": \"Pagination\",\n    \"route\": \"/components/pagination\",\n    \"illustration\": \"pagination.png\",\n    \"summary\": \"A <b>pagination</b> component gives users more navigational capability on pages with content views.\"\n  },\n  \"panel\": {\n    \"name\": \"panel\",\n    \"title\": \"Panel\",\n    \"route\": \"/components/panel\",\n    \"clazz\": \"org.patternfly.component.panel.Panel\",\n    \"illustration\": \"panel.png\",\n    \"summary\": \"The <b>panel</b> component is a container that supports flexible content layouts. It can be used to house other components such as fields, forms, videos, buttons, and more. The panel should not be confused with the <a href=\'https://www.patternfly.org/components/drawer/design-guidelines/\' target=\'patternfly\'>drawer</a> component, which allows you to surface information via a collapsable container.\"\n  },\n  \"password-generator\": {\n    \"name\": \"password-generator\",\n    \"title\": \"Password generator\",\n    \"route\": \"/components/password-generator\",\n    \"illustration\": \"password-generator.png\",\n    \"summary\": \"This demo shows you how to create an input field that can be used to generate unique passwords.\"\n  },\n  \"password-strength\": {\n    \"name\": \"password-strength\",\n    \"title\": \"Password strength\",\n    \"route\": \"/components/password-strength\",\n    \"illustration\": \"password-strength.png\",\n    \"summary\": \"This demo shows how to use PatternFly component to validate and return feedback about password strength according to consumer-defined rules.\"\n  },\n  \"popover\": {\n    \"name\": \"popover\",\n    \"title\": \"Popover\",\n    \"route\": \"/components/popover\",\n    \"clazz\": \"org.patternfly.component.popover.Popover\",\n    \"illustration\": \"popover.png\",\n    \"summary\": \"A <b>popover</b> is in-app messaging that provides more information on specific product areas. Popovers display content in a new window that overlays the current page. Unlike modals, popovers don\'t block the current page.\"\n  },\n  \"progress-stepper\": {\n    \"name\": \"progress-stepper\",\n    \"title\": \"Progress stepper\",\n    \"route\": \"/components/progress-stepper\",\n    \"illustration\": \"progress-stepper.png\",\n    \"summary\": \"A <b>progress stepper</b> displays a timeline of tasks in a workflow and tracks the user\'s current progress through this workflow.\"\n  },\n  \"progress\": {\n    \"name\": \"progress\",\n    \"title\": \"Progress\",\n    \"route\": \"/components/progress\",\n    \"clazz\": \"org.patternfly.component.progress.Progress\",\n    \"illustration\": \"progress.png\",\n    \"summary\": \"A <b>progress</b> bar informs users about the completion status of an ongoing process or task.\"\n  },\n  \"radio\": {\n    \"name\": \"radio\",\n    \"title\": \"Radio\",\n    \"route\": \"/components/forms/radio\",\n    \"clazz\": \"org.patternfly.component.menu.Radio\",\n    \"illustration\": \"radio.png\",\n    \"summary\": \"A <b>radio</b> button is used to present the user with mutually exclusive choices. Always present radio buttons in groups of 2 or more.\"\n  },\n  \"search-input\": {\n    \"name\": \"search-input\",\n    \"title\": \"Search input\",\n    \"route\": \"/components/search-input\",\n    \"illustration\": \"search-input.png\",\n    \"summary\": \"A <b>search input</b> is a type of input field that can be user to search, find, or filter. See <a href=\'https://www.patternfly.org/patterns/filters/design-guidelines\' target=\'patternfly\'>filter guidelines</a> for more information on using search input as a filter.\"\n  },\n  \"select\": {\n    \"name\": \"select\",\n    \"title\": \"Select\",\n    \"route\": \"/components/menus/select\",\n    \"illustration\": \"select.png\",\n    \"summary\": \"A <b>select</b> list enables users to select one or more items from a list. Use a select list when options are dynamic or variable.\"\n  },\n  \"sidebar\": {\n    \"name\": \"sidebar\",\n    \"title\": \"Sidebar\",\n    \"route\": \"/components/sidebar\",\n    \"clazz\": \"org.patternfly.component.page.Sidebar\",\n    \"illustration\": \"sidebar.png\",\n    \"summary\": \"A <b>sidebar</b> splits content into a secondary area that can be placed relative to the main content on a page.\"\n  },\n  \"simple-list\": {\n    \"name\": \"simple-list\",\n    \"title\": \"Simple list\",\n    \"route\": \"/components/simple-list\",\n    \"clazz\": \"org.patternfly.component.list.SimpleList\",\n    \"illustration\": \"simple-list.png\",\n    \"summary\": \"A <b>simple list</b> provides a list of selectable items that can be shown within a page. Each item is described by a text label. The list may be divided into logical sections by introducing group headers.\"\n  },\n  \"skeleton\": {\n    \"name\": \"skeleton\",\n    \"title\": \"Skeleton\",\n    \"route\": \"/components/skeleton\",\n    \"clazz\": \"org.patternfly.component.skeleton.Skeleton\",\n    \"illustration\": \"skeleton.png\",\n    \"summary\": \"A <b>skeleton</b> is a type of loading state that allows you to expose content incrementally. For content that may take a long time to load, use a <a href=\'/components/progress\'>progress bar</a> in place of a skeleton.\"\n  },\n  \"skip-to-content\": {\n    \"name\": \"skip-to-content\",\n    \"title\": \"Skip to content\",\n    \"route\": \"/components/skip-to-content\",\n    \"clazz\": \"org.patternfly.component.skiptocontent.SkipToContent\",\n    \"illustration\": \"skip-to-content.png\",\n    \"summary\": \"A <b>skip to content</b> component allows screen reader and keyboard users to bypass navigation rather than tabbing through it.\"\n  },\n  \"slider\": {\n    \"name\": \"slider\",\n    \"title\": \"Slider\",\n    \"route\": \"/components/slider\",\n    \"clazz\": \"org.patternfly.component.slider.Slider\",\n    \"illustration\": \"slider.png\",\n    \"summary\": \"A <b>slider</b> provides a quick and effective way for users to set and adjust a numeric value from a defined range of values.\"\n  },\n  \"spinner\": {\n    \"name\": \"spinner\",\n    \"title\": \"Spinner\",\n    \"route\": \"/components/spinner\",\n    \"clazz\": \"org.patternfly.component.spinner.Spinner\",\n    \"illustration\": \"spinner.png\",\n    \"summary\": \"A <b>spinner</b> is used to indicate to users that an action is in progress. For actions that may take a long time, use a <a href=\'/components/progress\'>progress bar</a> instead.\"\n  },\n  \"switch\": {\n    \"name\": \"switch\",\n    \"title\": \"Switch\",\n    \"route\": \"/components/switch\",\n    \"clazz\": \"org.patternfly.component.switch.Switch\",\n    \"illustration\": \"switch.png\",\n    \"summary\": \"A <b>switch</b> toggles the state of a setting (between on and off). Switches and <a href=\'/components/forms/checkbox\'>checkboxes</a> can often be used interchangeably, but the switch provides a more explicit, visible representation on a setting.\"\n  },\n  \"table\": {\n    \"name\": \"table\",\n    \"title\": \"Table\",\n    \"route\": \"/components/table\",\n    \"illustration\": \"table.png\",\n    \"summary\": \"A <b>table</b> is used to display large data sets that can be easily laid out in a simple grid with column headers.\"\n  },\n  \"tabs\": {\n    \"name\": \"tabs\",\n    \"title\": \"Tabs\",\n    \"route\": \"/components/tabs\",\n    \"clazz\": \"org.patternfly.component.tabs.Tabs\",\n    \"illustration\": \"tabs.png\",\n    \"summary\": \"<b>Tabs</b> allow users to navigate between views within the same page or context.\"\n  },\n  \"text-area\": {\n    \"name\": \"text-area\",\n    \"title\": \"Text area\",\n    \"route\": \"/components/forms/text-area\",\n    \"clazz\": \"org.patternfly.component.form.TextArea\",\n    \"illustration\": \"text-area.png\",\n    \"summary\": \"A <b>text area</b> component is used for entering a paragraph of text that is longer than one line.\"\n  },\n  \"text-input-group\": {\n    \"name\": \"text-input-group\",\n    \"title\": \"Text input group\",\n    \"route\": \"/components/text-input-group\",\n    \"clazz\": \"org.patternfly.component.textinputgroup.TextInputGroup\",\n    \"illustration\": \"text-input-group.png\",\n    \"summary\": \"A <b>text input group</b> is a more flexible composable version of a <a href=\'/components/forms/text-input\'>text input</a>. It enables consumers of PatternFly to build custom inputs for filtering and similar use cases by placing elements like icons, <a href=\'/components/chip#chip-groups\'>chips groups</a> and <a href=\'/components/button\'>buttons</a> within a text input.\"\n  },\n  \"text-input\": {\n    \"name\": \"text-input\",\n    \"title\": \"Text input\",\n    \"route\": \"/components/forms/text-input\",\n    \"clazz\": \"org.patternfly.component.form.TextInput\",\n    \"illustration\": \"text-input.png\",\n    \"summary\": \"A <b>text input</b> is used to gather free-form text from a user.\"\n  },\n  \"text\": {\n    \"name\": \"text\",\n    \"title\": \"Text\",\n    \"route\": \"/components/text\",\n    \"clazz\": \"org.patternfly.component.text.TextContent\",\n    \"illustration\": \"text.png\",\n    \"summary\": \"<b>Text</b> and <b>TextList</b> components are always wrapped in <b>TextContent</b> and provide correct formatting to a number of standard HTML tags.\"\n  },\n  \"tile\": {\n    \"name\": \"tile\",\n    \"title\": \"Tile\",\n    \"route\": \"/components/tile\",\n    \"illustration\": \"tile.png\",\n    \"summary\": \"A <b>tile</b> component is a form of selection that can be used in place of a <a href=\'/components/radio\'>radio button</a> and is commonly used in <a href=\'/components/form\'>forms</a>. A tile appears visually similar to a <a href=\'/components/card/\'>selectable card</a>. However, tiles are used specifically when the user is selecting a static option, whereas a selectable card triggers an action or opens a quickstart or sidebar to provide additional information.\"\n  },\n  \"time-picker\": {\n    \"name\": \"time-picker\",\n    \"title\": \"Time picker\",\n    \"route\": \"/components/date-and-time/time-picker\",\n    \"illustration\": \"time-picker.png\",\n    \"summary\": \"A <b>time picker</b> allows users to select a time from a list of options. Time can be displayed in hours and minutes, but not in seconds.\"\n  },\n  \"timestamp\": {\n    \"name\": \"timestamp\",\n    \"title\": \"Timestamp\",\n    \"route\": \"/components/date-and-time/timestamp\",\n    \"illustration\": \"timestamp.png\",\n    \"summary\": \"A <b>timestamp</b> provides consistent formats for displaying date and time values.\"\n  },\n  \"title\": {\n    \"name\": \"title\",\n    \"title\": \"Title\",\n    ').m_append__java_lang_String__java_lang_StringBuilder('\"route\": \"/components/title\",\n    \"clazz\": \"org.patternfly.component.title.Title\",\n    \"illustration\": \"title.png\",\n    \"summary\": \"A <b>title</b> component applies top and bottom margins, font-weight, font-size, and line-height to titles. The most common usage for a title is to define headings within a page. For more information about the relationship between title component sizes and HTML heading levels, see the <a href=\'https://www.patternfly.org/design-foundations/typography#customizing-heading-levels\' target=\'patternfly\'>Typography guidelines</a>.\"\n  },\n  \"toggle-group\": {\n    \"name\": \"toggle-group\",\n    \"title\": \"Toggle group\",\n    \"route\": \"/components/toggle-group\",\n    \"clazz\": \"org.patternfly.component.togglegroup.ToggleGroup\",\n    \"illustration\": \"toggle-group.png\",\n    \"summary\": \"A <b>toggle group</b> is a group of controls that can be used to quickly switch between actions or states.\"\n  },\n  \"toolbar\": {\n    \"name\": \"toolbar\",\n    \"title\": \"Toolbar\",\n    \"route\": \"/components/toolbar\",\n    \"clazz\": \"org.patternfly.component.toolbar.Toolbar\",\n    \"illustration\": \"toolbar.png\",\n    \"summary\": \"A <b>toolbar</b> allows a user to manage and manipulate a data set. Data can be presented in any valid presentation, a table, a list, or a data visualization (chart), for example. The toolbar responsively accommodates controls and displays applied filters in chip groups.\"\n  },\n  \"tooltip\": {\n    \"name\": \"tooltip\",\n    \"title\": \"Tooltip\",\n    \"route\": \"/components/tooltip\",\n    \"clazz\": \"org.patternfly.component.tooltip.Tooltip\",\n    \"illustration\": \"tooltip.png\",\n    \"summary\": \"A <b>tooltip</b> is in-app messaging used to identify elements on a page with short, clarifying text.\"\n  },\n  \"tree-view\": {\n    \"name\": \"tree-view\",\n    \"title\": \"Tree view\",\n    \"route\": \"/components/tree-view\",\n    \"illustration\": \"tree-view.png\",\n    \"summary\": \"A <b>tree view</b> is a structure that displays data in a hierarchical view. It can be used in a <a href=\'/components/menus/dropdown\'>dropdown</a>, <a href=\'/components/drawer\'>drawer</a>, <a href=\'https://www.patternfly.org/patterns/primary-detail\' target=\'patternfly\'>primary-detail</a>, <a href=\'/components/modal\'>modal</a>, or <a href=\'/components/wizard\'>wizard</a>.\"\n  },\n  \"truncate\": {\n    \"name\": \"truncate\",\n    \"title\": \"Truncate\",\n    \"route\": \"/components/truncate\",\n    \"clazz\": \"org.patternfly.component.truncate.Truncate\",\n    \"illustration\": \"truncate.png\",\n    \"summary\": \"A <b>truncate</b> is a tool used to shorten numeric and non-numeric character strings, typically when the string overflows its container.\"\n  },\n  \"wizard\": {\n    \"name\": \"wizard\",\n    \"title\": \"Wizard\",\n    \"route\": \"/components/wizard\",\n    \"illustration\": \"wizard.png\",\n    \"summary\": \"A <b>wizard</b> provides a guided workflow that offers a path to complete a task, create an object or objects, or finish a series of steps for some other outcome. Wizards should incite trust in the user and guide them through an otherwise overwhelming experience.\"\n  }\n}\n').toString();
